import React from 'react';
import MediaCard from './MediaCard';

class MediaList extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return <section>
            <h2>
                <ul>
                        <MediaCard/>
                        <MediaCard/>
                        <MediaCard/>
                </ul>
            </h2>
        </section>
        
    }

}

export default MediaList;
